import React from "react";
import './Form.css';

class Form extends React.Component {
    render() {
        return (
            <form className="form">
                <fieldset>
                    <legend>Informações pessoais</legend>
                    <input type="text" name="name" placeholder="Nome" required="required" maxLength="40"/>
                    <input type="email" name="email" placeholder="E-mail" required="required" maxLength="50"/>
                    <input type="text" name="cpf" placeholder="CPF" required="required" maxLength="11"/>
                </fieldset>
            </form>
        )
    }
}

export default Form;
